import './Home.css';
import {gsap} from 'gsap';
import SplitType from 'split-type'

function Home() {

	const myText = new SplitType('.intro-name');

        gsap.from('.char', {
            y: 0,
            stagger: 0.05,
            delay: 0.2,
            duration: .1
        })


	return (
		<div className='Home'>
			<div id='intro'>
				<div>
					<div id='intro-words'>
						<div className='intro-name'>AASHNA</div>
						<div className='intro-name'>VERMA</div>
						<div id='intro-role'>- Software engineering student -</div>
					</div>
					<div className='circle'></div>
				</div>
			</div>
		</div>
	);
}

export default Home;
